TREE'bs.TextColor3=Color3.new(1,1,1)bs.TextWrapped=true;bs.TextSize=14;bt.Name='DupeFrame'bt.Parent=aL;bt.BackgroundColor3=Color3.new(0,0,0)bt.BackgroundTransparency=0;bt.BorderColor3=Color3.new(0,1,0)bt.Size=UDim2.new(0,170,0,290)bt.Visible=false;bu.Name='Info'bu.Parent=bt;bu.BackgroundColor3=Color3.new(0,0,0)bu.BorderColor3=Color3.new(0,1,0)bu.Position=UDim2.new(0,185,1,-370)bu.Size=UDim2.new(0,170,0,410)bu.Visible=false;bu.Font=Enum.Font.Fantasy;bu.FontSize=Enum.FontSize.Size14;bu.Text='1. Make sure no Save Slot is loaded in (or unload it).
2. Click the 'Dupe' button.
3. The button will turn green.
4. Load the Save Slot you want to dupe from.
5. After it's loaded check the Slot does not say 'Current'.
6. Whitelist the person you want to move [dupe] your items to and make sure they aren't blacklisted
7. Move the items you want to dupe to your friends base.
8. Once you are done, reload your Save Slot that you just moved your items from.
